import ResponsiveMenu from 'react-responsive-navbar';
import {FaBars,FaTimes} from 'react-icons/fa';
import 'bootstrap/dist/css/bootstrap.css';
import './Menu.scss';


export function Menu () {

    return (
        <header className="container-fluid container-header px-0 ">
            <div className="row w-100 container-title mx-0 position-relative">
              <div className="col-10">
                <h2>Casa A Pasada</h2> 
                <p>tlfn: 981 483 623</p>
              </div>

            <div className="col position-absolute top-0 end-0">
            <ResponsiveMenu
              menuOpenButton={<FaBars/>}
              menuCloseButton={<FaTimes/>}
              changeMenuOn="1000px"
              largeMenuClassName="large-menu-classname"
              smallMenuClassName="small-menu-classname"
              menu={
                 <ul className="row">
                    <li className="col4 item">
                      <a href="#">Descubre Ortegal</a>
                    </li>
                    <li className="col item">
                      <a href="#">Habitaciones</a>
                    </li>
                    <li className="col item">
                          <a href="#">Contacto</a>
                    </li>
                </ul>
              }
            />
            </div>
            </div>

        </header>
    )
}

export default Menu;
